	info.push({
	  title: 'УХОД ЗА ЛИЦОМ',
	  content: '\n    <div class="content_modal">\n      <p><strong>\u041C\u0430\u0441\u0441\u0430\u0436 \u043B\u0438\u0446\u0430: </strong></p>\n      <ul>\n        <li>\u041C\u0430\u0441\u0441\u0430\u0436-\u0431\u043B\u0435\u0444\u0430\u0440\u043E\u043F\u043B\u0430\u0441\u0442\u0438\u043A\u0430</li>\n        <li>\u041C\u0438\u043E\u043F\u043B\u0430\u0441\u0442\u0438\u043A\u0430 \u043B\u0438\u0446\u0430</li>\n        <li>\u0418\u0441\u043F\u0430\u043D\u0441\u043A\u0438\u0439 \u043C\u0430\u0441\u0441\u0430\u0436 \u043B\u0438\u0446\u0430 (\u0441\u043E\u0432\u043C\u0435\u0441\u0442\u043D\u043E \u0441 \u0434\u0440\u0443\u0433\u0438\u043C\u0438 \u043F\u0440\u043E\u0446\u0435\u0434\u0443\u0440\u0430\u043C\u0438 \u043F\u043E \u0443\u0445\u043E\u0434\u0443 \u0437\u0430 \u043B\u0438\u0446\u043E\u043C)</li>\n        <li>\u042F\u043F\u043E\u043D\u0441\u043A\u0438\u0439 \u043C\u0430\u0441\u0441\u0430\u0436 \u0434\u043B\u044F \u043B\u0438\u0446\u0430 \xAB\u041A\u043E\u0431\u0438\u0434\u043E\xBB</li>\n        <li>\u041E\u0440\u0442\u043E\u0441\u043E\u043C\u0430\u0442\u0438\u0447\u0435\u0441\u043A\u0438\u0439 \u043C\u0430\u0441\u0441\u0430\u0436 \u0434\u043B\u044F \u043B\u0438\u0446\u0430 \u0438 \u0442\u0435\u043B\u0430</li>\n        <li>LPG-\u043C\u0430\u0441\u0441\u0430\u0436 \u043B\u0438\u0446\u0430 \u0438 \u0448\u0435\u0438 (\u044D\u043D\u0434\u0435\u0440\u043C\u043E\u043B\u043E\u0433\u0438\u0447\u0435\u0441\u043A\u0438\u0439 \u043B\u0438\u043F\u043E\u043C\u0430\u0441\u0441\u0430\u0436)</li>\n      </ul>\n      <p><strong>\u0410\u043F\u043F\u0430\u0440\u0430\u0442\u043D\u0430\u044F \u043A\u043E\u0441\u043C\u0435\u0442\u043E\u043B\u043E\u0433\u0438\u044F:</strong></p>\n      <ul>\n        <li>\u041B\u0430\u0437\u0435\u0440\u043D\u043E\u0435 \u043E\u043C\u043E\u043B\u043E\u0436\u0435\u043D\u0438\u0435 \u043B\u0438\u0446\u0430 \u0438 \u0442\u0435\u043B\u0430;</li>\n        <li>\u041B\u0435\u0447\u0435\u043D\u0438\u0435 \u0430\u043A\u043D\u0435;</li>\n        <li>\u0424\u0440\u0430\u043A\u0446\u0438\u043E\u043D\u043D\u044B\u0439 \u0442\u0435\u0440\u043C\u043E\u043B\u0438\u0437;</li>\n        <li>\u041A\u043E\u0440\u0440\u0435\u043A\u0446\u0438\u044F \u0433\u0438\u043F\u0435\u0440\u0442\u0440\u043E\u0444\u0438\u0447\u0435\u0441\u043A\u0438\u0445, \u0430\u0442\u0440\u043E\u0444\u0438\u0447\u0435\u0441\u043A\u0438\u0445 \u0438 \u043F\u043E\u0441\u0442\u0430\u043A\u043D\u0435 \u0440\u0443\u0431\u0446\u043E\u0432\u044B\u0445 \u0438\u0437\u043C\u0435\u043D\u0435\u043D\u0438\u0439;</li>\n        <li>\u0423\u0434\u0430\u043B\u0435\u043D\u0438\u0435 \u043F\u0430\u043F\u0438\u043B\u043B\u043E\u043C;</li>\n        <li>\u0423\u0434\u0430\u043B\u0435\u043D\u0438\u0435 \u0431\u043E\u0440\u043E\u0434\u0430\u0432\u043E\u043A, \u043A\u0430\u043D\u0434\u0438\u043B\u043E\u043C, \u043D\u0435\u0432\u0443\u0441\u043E\u0432;</li>\n        <li>\u0423\u0434\u0430\u043B\u0435\u043D\u0438\u0435 \u0441\u043E\u0441\u0443\u0434\u043E\u0432;</li>\n        <li>\u0418\u043D\u0442\u0438\u043C\u043D\u043E\u0435 \u043B\u0430\u0437\u0435\u0440\u043D\u043E\u0435 \u043E\u043C\u043E\u043B\u043E\u0436\u0435\u043D\u0438\u0435.</li>\n      </ul>\n      <p><strong>\u0412\u0441\u0435 \u0432\u0438\u0434\u044B \u0441\u0430\u043C\u044B\u0445 \u044D\u0444\u0444\u0435\u043A\u0442\u0438\u0432\u043D\u044B\u0445 \u0438\u043D\u044C\u0435\u043A\u0446\u0438\u043E\u043D\u043D\u044B\u0445 \u043C\u0435\u0442\u043E\u0434\u0438\u043A: </strong></p>\n      <ul>\n        <li>\u041F\u043B\u0430\u0437\u043C\u043E\u043B\u0438\u0444\u0442\u0438\u043D\u0433</li>\n        <li>\u041C\u0435\u0437\u043E\u0442\u0435\u0440\u0430\u043F\u0438\u044F (\u043B\u0438\u0446\u043E, \u0448\u0435\u044F, \u043A\u043E\u0436\u0430 \u0433\u043E\u043B\u043E\u0432\u044B)</li>\n        <li>\u041C\u0435\u0437\u043E\u043D\u0438\u0442\u0438</li>\n        <li>\u041A\u043E\u043D\u0442\u0443\u0440\u043D\u0430\u044F \u043F\u043B\u0430\u0441\u0442\u0438\u043A\u0430</li>\n        <li>\u0414\u0438\u0441\u043F\u043E\u0440\u0442</li>\n        <li>\u0411\u0438\u043E\u0440\u0435\u0432\u0438\u0442\u0430\u043B\u0438\u0437\u0430\u0446\u0438\u044F</li>\n        <li>\u0412\u0432\u0435\u0434\u0435\u043D\u0438\u0435 \u043B\u0438\u043F\u043E\u043B\u0438\u0442\u0438\u043A\u043E\u0432</li>\n      </ul>\n    </div>',
	  image: document.URL + 'images/services_5.jpg'
	});

