	info.push({
	  title: 'АКВА-ПРОЦЕДУРЫ',
	  content: '\n    <div class="content_modal">\n      <p>\u0413\u043E\u0440\u0434\u043E\u0441\u0442\u044C Celebrity SPA - \u0432\u0435\u043B\u0438\u043A\u043E\u043B\u0435\u043F\u043D\u0430\u044F \u0430\u043A\u0432\u0430-\u0437\u043E\u043D\u0430 \u0441 \u0440\u043E\u0441\u043A\u043E\u0448\u043D\u044B\u043C\u0438 VIP-\u0441\u0430\u0443\u043D\u0430\u043C\u0438 \u0438 \u043F\u0440\u043E\u0446\u0435\u0434\u0443\u0440\u043D\u044B\u043C\u0438 \u043A\u043E\u043C\u043D\u0430\u0442\u0430\u043C\u0438, \u043E\u0441\u043D\u0430\u0449\u0435\u043D\u043D\u044B\u043C\u0438 \u0431\u0430\u043B\u044C\u043D\u0435\u043E\u043B\u043E\u0433\u0438\u0447\u0435\u0441\u043A\u0438\u043C \u043E\u0431\u043E\u0440\u0443\u0434\u043E\u0432\u0430\u043D\u0438\u0435\u043C \u043E\u0442 \u0432\u0435\u0434\u0443\u0449\u0435\u0433\u043E \u0435\u0432\u0440\u043E\u043F\u0435\u0439\u0441\u043A\u043E\u0433\u043E \u043F\u0440\u043E\u0438\u0437\u0432\u043E\u0434\u0438\u0442\u0435\u043B\u044F Trautwein.</p>\n      <ul>\n        <li>VIP-c\u0430\u0443\u043D\u0430 (\u0440\u0443\u0441\u0441\u043A\u0430\u044F \u0431\u0430\u043D\u044F) \u0434\u043B\u044F \u043A\u043E\u043C\u043F\u0430\u043D\u0438\u0438 \u0434\u043E 6 \u0447\u0435\u043B\u043E\u0432\u0435\u043A</li>\n        <li>VIP-c\u0430\u0443\u043D\u0430 (\u0440\u0443\u0441\u0441\u043A\u0430\u044F \u0431\u0430\u043D\u044F) \u0434\u043B\u044F \u043A\u043E\u043C\u043F\u0430\u043D\u0438\u0438 \u0434\u043E 4 \u0447\u0435\u043B\u043E\u0432\u0435\u043A</li>\n        <li>\u042D\u043A\u0441\u043F\u0440\u0435\u0441\u0441-\u043F\u0430\u0440\u0435\u043D\u0438\u0435</li>\n        <li>\u0414\u0443\u0448 \u0428\u0430\u0440\u043A\u043E</li>\n        <li>Thermo-SPA</li>\n      </ul>\n      <p>Thermo-SPA \u2013 \u0441\u043F\u0435\u0446\u0438\u0430\u043B\u044C\u043D\u044B\u0439 \u0430\u043F\u043F\u0430\u0440\u0430\u0442 \u0434\u043B\u044F \u043A\u043E\u0441\u043C\u0435\u0442\u0438\u0447\u0435\u0441\u043A\u0438\u0445 \u043E\u0431\u0435\u0440\u0442\u044B\u0432\u0430\u043D\u0438\u0439, \u0432 \u0442\u043E\u043C \u0447\u0438\u0441\u043B\u0435 \u0441 \u043A\u043E\u043C\u0431\u0438\u043D\u0430\u0446\u0438\u0435\u0439 \u0442\u0430\u043B\u0430\u0441\u0441\u043E-, \u0430\u0440\u043E\u043C\u0430\u0442\u0435\u0440\u0430\u043F\u0438\u0438, \u0431\u0430\u043B\u044C\u043D\u0435\u043E\u043B\u043E\u0433\u0438\u0447\u0435\u0441\u043A\u0438\u0445 \u043F\u0440\u043E\u0446\u0435\u0434\u0443\u0440. \u0412\u044B \u0441\u043C\u043E\u0436\u0435\u0442\u0435 \u043F\u0430\u0440\u0438\u0442\u044C \u043D\u0430\u0434 \u0432\u043E\u0434\u043E\u0439! \u041D\u043E\u0432\u044B\u0435 \u0432\u043F\u0435\u0447\u0430\u0442\u043B\u0435\u043D\u0438\u044F \u0434\u043B\u044F \u0412\u0430\u0441 \u043D\u0430\u0447\u0438\u043D\u0430\u044E\u0442\u0441\u044F \u0441\u0440\u0430\u0437\u0443 \u0436\u0435 \u043F\u043E\u0441\u043B\u0435 \u043D\u0430\u043D\u0435\u0441\u0435\u043D\u0438\u044F \u043D\u0430 \u0442\u0435\u043B\u043E \u0430\u0440\u043E\u043C\u0430\u0442\u0438\u0447\u0435\u0441\u043A\u0438\u0445 \u044D\u0441\u0441\u0435\u043D\u0446\u0438\u0439. \u0417\u0430\u0442\u0435\u043C \u0412\u0430\u0441 \u0443\u043A\u043B\u0430\u0434\u044B\u0432\u0430\u044E\u0442 \u043D\u0430 \u043C\u044F\u0433\u043A\u0443\u044E \u043F\u043E\u0432\u0435\u0440\u0445\u043D\u043E\u0441\u0442\u044C. \u041F\u0440\u0438 \u044D\u0442\u043E\u043C \u043D\u0430\u0441\u0442\u0443\u043F\u0430\u0435\u0442 \u044D\u0444\u0444\u0435\u043A\u0442 \u0440\u0435\u043B\u0430\u043A\u0441\u0430\u0446\u0438\u0438. \u0412\u0430\u043D\u043D\u0430 \u043F\u043E\u0434\u043D\u0438\u043C\u0430\u0435\u0442\u0441\u044F \u043D\u0430\u0432\u0435\u0440\u0445, \u0438 \u0412\u044B, \u043B\u0435\u0436\u0430 \u043D\u0430 \u0432\u043E\u0434\u044F\u043D\u043E\u0439 \u043F\u043E\u0441\u0442\u0435\u043B\u0438, \u043D\u0430\u0441\u043B\u0430\u0436\u0434\u0430\u0435\u0442\u0435\u0441\u044C \xAB\u043D\u0435\u0432\u0435\u0441\u043E\u043C\u043E\u0441\u0442\u044C\u044E\xBB, \u043E\u043A\u0443\u0442\u0430\u043D\u043D\u044B\u0435 \u043F\u0440\u0438\u044F\u0442\u043D\u044B\u043C \u0442\u0435\u043F\u043B\u043E\u043C. \u0412\u043F\u0435\u0447\u0430\u0442\u043B\u0435\u043D\u0438\u0435 \u043A\u0430\u043A \u043D\u0430 \u0441\u0435\u0434\u044C\u043C\u043E\u043C \u043D\u0435\u0431\u0435! \u0412\u043E\u0434\u0430, \u043D\u0430\u0445\u043E\u0434\u044F\u0449\u0430\u044F\u0441\u044F \u0432 \u0432\u0430\u043D\u043D\u0435, \u043E\u0431\u043E\u0433\u0440\u0435\u0432\u0430\u0435\u0442 \u0438 \u043E\u043A\u043E\u043D\u0447\u0430\u0442\u0435\u043B\u044C\u043D\u043E \u043F\u0435\u0440\u0435\u043D\u043E\u0441\u0438\u0442 \u0432 \u043C\u0438\u0440 \u0433\u0440\u0435\u0437...</p>\n    </div>',
	  image: document.URL + 'images/services_6.jpg'
	});

