	info.push({
	  title: 'ДЕПИЛЯЦИЯ',
	  content: '\n    <div class="content_modal">\n      <ul>\n        <li>\u0414\u0435\u043F\u0438\u043B\u044F\u0446\u0438\u044F \u0432\u043E\u0441\u043A\u043E\u043C</li>\n        <li>\u0421\u0430\u0445\u0430\u0440\u043D\u0430\u044F \u0434\u0435\u043F\u0438\u043B\u044F\u0446\u0438\u044F (\u0448\u0443\u0433\u0430\u0440\u0438\u043D\u0433)</li>\n        <li>\u0422\u0440\u0438\u0434\u0438\u043D\u0433 (\u0443\u0434\u0430\u043B\u0435\u043D\u0438\u0435 \u0432\u043E\u043B\u043E\u0441 \u043D\u0438\u0442\u044C\u044E)</li>\n        <li>\u041B\u0430\u0437\u0435\u0440\u043D\u0430\u044F \u044D\u043F\u0438\u043B\u044F\u0446\u0438\u044F</li>\n      </ul>\n      <h6>\u0412\u044B\u0441\u043E\u043A\u043E\u043C\u043E\u0449\u043D\u044B\u0439 \u0430\u043F\u043F\u0430\u0440\u0430\u0442 MEDIOSTAR NEXT \u043F\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u043B\u044F\u0435\u0442 \u0441\u043E\u0431\u043E\u0439 \u0432\u043E\u043F\u043B\u043E\u0449\u0435\u043D\u0438\u0435 \u043F\u043E\u0441\u043B\u0435\u0434\u043D\u0438\u0445 \u043D\u0430\u0443\u0447\u043D\u044B\u0445 \u043E\u0442\u043A\u0440\u044B\u0442\u0438\u0439 \u0432 \u043B\u0430\u0437\u0435\u0440\u043D\u043E\u0439 \u044D\u043F\u0438\u043B\u044F\u0446\u0438\u0438. \u0411\u0435\u0437\u0431\u043E\u043B\u0435\u0437\u043D\u0435\u043D\u043D\u043E \u0438 \u0431\u0435\u0441\u0441\u043B\u0435\u0434\u043D\u043E! \u0412\u044B\u043F\u043E\u043B\u043D\u044F\u0435\u0442\u0441\u044F \u043D\u0430 \u043A\u043E\u0436\u0435 \u043B\u044E\u0431\u043E\u0433\u043E \u0444\u043E\u0442\u043E\u0442\u0438\u043F\u0430 (I-VI), \u043D\u0435\u0437\u0430\u0432\u0438\u0441\u0438\u043C\u043E \u043E\u0442 \u0442\u043E\u043B\u0449\u0438\u043D\u044B \u0438 \u0446\u0432\u0435\u0442\u0430 \u0432\u043E\u043B\u043E\u0441.</h6>\n    </div>',
	  image: document.URL + 'images/services_7.jpg'
	});

