	info.push({
	  title: 'КРИОТЕРАПИЯ ЖИДКИМ АЗОТОМ',
	  content: '\n    <div class="content_modal">\n      <p>\u041A\u0440\u0438\u043E\u0442\u0435\u0440\u0430\u043F\u0438\u044F \u2013 \u043B\u0435\u0447\u0435\u043D\u0438\u0435 \u0445\u043E\u043B\u043E\u0434\u043E\u043C. \u0422\u0430\u043A\u0430\u044F \u043F\u0440\u043E\u0446\u0435\u0434\u0443\u0440\u0430 \u0438\u043C\u0435\u0435\u0442 \u043B\u0435\u0433\u043A\u043E\u0435 \u0441\u0442\u0438\u043C\u0443\u043B\u0438\u0440\u0443\u044E\u0449\u0435\u0435 \u0442\u0435\u0440\u0430\u043F\u0435\u0432\u0442\u0438\u0447\u0435\u0441\u043A\u043E\u0435 \u0434\u0435\u0439\u0441\u0442\u0432\u0438\u0435, \u0434\u0430\u0435\u0442 \u0432\u044B\u0440\u0430\u0436\u0435\u043D\u043D\u044B\u0439 \u0438\u043C\u043C\u0443\u043D\u043E\u043C\u043E\u0434\u0443\u043B\u0438\u0440\u0443\u044E\u0449\u0438\u0439, \u043F\u0440\u043E\u0442\u0438\u0432\u043E\u0432\u043E\u0441\u043F\u0430\u043B\u0438\u0442\u0435\u043B\u044C\u043D\u044B\u0439 \u0438 \u043E\u0431\u0435\u0437\u0431\u043E\u043B\u0438\u0432\u0430\u044E\u0449\u0438\u0439 \u044D\u0444\u0444\u0435\u043A\u0442\u044B. \u0425\u043E\u043B\u043E\u0434 \u0441\u043D\u0430\u0447\u0430\u043B\u0430 \u0432\u044B\u0437\u044B\u0432\u0430\u0435\u0442 \u0440\u0435\u0437\u043A\u0438\u0439 \u0441\u043F\u0430\u0437\u043C \u0441\u043E\u0441\u0443\u0434\u043E\u0432, \u0430 \u0437\u0430\u0442\u0435\u043C \u0438\u0445 \u0434\u043E\u0441\u0442\u0430\u0442\u043E\u0447\u043D\u043E \u0441\u0442\u043E\u0439\u043A\u043E\u0435 \u0440\u0430\u0441\u0448\u0438\u0440\u0435\u043D\u0438\u0435.</p>\n      <p>\u0417\u0430 \u0441\u0447\u0451\u0442 \u044D\u0442\u043E\u0433\u043E \u0443\u043B\u0443\u0447\u0448\u0430\u0435\u0442\u0441\u044F \u043F\u0435\u0440\u0438\u0444\u0435\u0440\u0438\u0447\u0435\u0441\u043A\u043E\u0435 \u043A\u0440\u043E\u0432\u043E\u0441\u043D\u0430\u0431\u0436\u0435\u043D\u0438\u0435 \u0438 \u0443\u0441\u043A\u043E\u0440\u044F\u044E\u0442\u0441\u044F \u0432\u0441\u0435 \u043E\u0431\u043C\u0435\u043D\u043D\u044B\u0435 \u043F\u0440\u043E\u0446\u0435\u0441\u0441\u044B, \u0431\u043B\u0430\u0433\u043E\u0434\u0430\u0440\u044F \u0447\u0435\u043C\u0443 \u0432 \u043A\u043E\u0436\u0443 \u043F\u043E\u0441\u0442\u0443\u043F\u0430\u044E\u0442 \u043D\u0435\u043E\u0431\u0445\u043E\u0434\u0438\u043C\u044B\u0435 \u0432\u0438\u0442\u0430\u043C\u0438\u043D\u044B, \u0430\u043C\u0438\u043D\u043E\u043A\u0438\u0441\u043B\u043E\u0442\u044B \u0438 \u043C\u0438\u043A\u0440\u043E\u044D\u043B\u0435\u043C\u0435\u043D\u0442\u044B.</p>\n      <p>\u041A\u0440\u0438\u043E\u0442\u0435\u0440\u0430\u043F\u0438\u044F \u0436\u0438\u0434\u043A\u0438\u043C \u0430\u0437\u043E\u0442\u043E\u043C \u0441\u043F\u043E\u0441\u043E\u0431\u0441\u0442\u0432\u0443\u0435\u0442 \u043E\u0442\u0448\u0435\u043B\u0443\u0448\u0438\u0432\u0430\u043D\u0438\u044E \u043F\u043E\u0432\u0435\u0440\u0445\u043D\u043E\u0441\u0442\u043D\u044B\u0445 \u0441\u043B\u043E\u0451\u0432 \u044D\u043F\u0438\u0434\u0435\u0440\u043C\u0438\u0441\u0430 \u0438 \u0437\u0430\u0440\u043E\u0436\u0434\u0435\u043D\u0438\u044E \u043C\u043E\u043B\u043E\u0434\u044B\u0445 \u0437\u0434\u043E\u0440\u043E\u0432\u044B\u0445 \u043A\u043B\u0435\u0442\u043E\u043A. \u041F\u043E\u0441\u043B\u0435 \u0442\u0430\u043A\u043E\u0439 \u043F\u0440\u043E\u0446\u0435\u0434\u0443\u0440\u044B \u0437\u043D\u0430\u0447\u0438\u0442\u0435\u043B\u044C\u043D\u043E \u0443\u043C\u0435\u043D\u044C\u0448\u0430\u0435\u0442\u0441\u044F \u0441\u0430\u043B\u043E\u043E\u0442\u0434\u0435\u043B\u0435\u043D\u0438\u0435 \u0438 \u043A\u043E\u0436\u0430 \xAB\u043E\u0436\u0438\u0432\u0430\u0435\u0442\xBB \u2013 \u0441\u0442\u0430\u043D\u043E\u0432\u0438\u0442\u0441\u044F \u0441\u0432\u0435\u0436\u0435\u0439, \u0440\u043E\u0437\u043E\u0432\u043E\u0439, \u043A\u0430\u043A \u0431\u044B \u0441\u0432\u0435\u0442\u044F\u0449\u0435\u0439\u0441\u044F \u0438\u0437\u043D\u0443\u0442\u0440\u0438. \u041A\u0440\u043E\u043C\u0435 \u0442\u043E\u0433\u043E \u0436\u0438\u0434\u043A\u0438\u0439 \u0430\u0437\u043E\u0442 \u0437\u0430\u043C\u0435\u0447\u0430\u0442\u0435\u043B\u044C\u043D\u043E \u0443\u0445\u0430\u0436\u0438\u0432\u0430\u0435\u0442, \u0441\u043F\u043E\u0441\u043E\u0431\u0441\u0442\u0432\u0443\u0435\u0442 \u043F\u0440\u043E\u0444\u0438\u043B\u0430\u043A\u0442\u0438\u043A\u0435 \u0435\u0451 \u0441\u0442\u0430\u0440\u0435\u043D\u0438\u044F.</p>\n      <ul>\n        <li>\u041A\u0440\u0438\u043E\u0442\u0435\u0440\u0430\u043F\u0438\u044F \u043A\u043E\u0436\u0438 \u0433\u043E\u043B\u043E\u0432\u044B</li>\n        <li>\u041A\u0440\u0438\u043E\u043C\u0430\u0441\u0441\u0430\u0436 \u043B\u0438\u0446\u0430</li>\n        <li>\u041A\u0440\u0438\u043E\u043C\u0430\u0441\u0441\u0430\u0436 \u0442\u0435\u043B\u0430 (\u0431\u0435\u0434\u0440\u0430, \u044F\u0433\u043E\u0434\u0438\u0446\u044B)</li>\n      </ul>\n    </div>',
	  image: document.URL + 'images/services_8.jpg'
	});

	exports.default = info;

